import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Order extends Component {

  render() {
    return (
      <div>
          <div id="nam">
              Bruce's Diner
          </div>
          <div id="Nav">
             Nav goes here
          </div>
          <div>
              Id Like to order
          </div>
          <div>
          <select id="cars">
            <option value="one">Volvo</option>
            <option value="two">Saab</option>
            <option value="three">Opel</option>
            <option value="aufourdi">Audi</option>
          </select>
          </div>
          <div>
              QTY & Order button
          </div>
      </div>
    );
  }
}
